import './App.css';
import React, { useState } from 'react'


function App() {
  const [number, setNumber] = useState(0)
  const action = {
    type:'increment'
  }

  const counterReducer = (state, action) => {
    if (action.type==='INCREMENT') {
      return state + 1
    } else if (action.type==='DECREMENT') {
      return state -1
    } else if (action.type==='ZERO') {
      return 0
    }
  }


  return (
    <div style={{margin: "30px"}}>

      {number}
      <div>
      <button>+</button>
      <button>-</button>
      <button>zero</button>
      </div>
    </div>
  )
}

export default App;
